      "date": "1731-01-02",
      "tags_section": "Zu vermiethen",
      "text": "Kaisers ist die Bewohnung auf dem ersten Stock zu verleihen, bestehend in 3 Stuben, Kuchin, Kammern, Sommerhaus, Keller 2c. nach Belieben zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "1. Es sucht jemand einen silbern Schreibzeug mit aller Zugehördt und schöner Fason, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "2. Man begehrt eine Chafse mit 4 Rädern zu et. wann 2 Pläsen und zu einem Pferd samt ge= hörigem Geschirr, der Liebhaber ist im Be= richthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "3. Wer hier oder auf dem Land noch neuen Träber,Brandtewein Ohnenweis zu verkaufen hat, kan im Berichtshaus einen Käufer darzu vernehmen, wie auch zu einem mittelmäsigen Sponton, so ebenfahls begehrt wird, beydes ohne Entgeldt im Berichtshaus ist zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "4. Es sucht jemand eine gute, solide und unge= fehr einen Saum haltende Feuerspritzen zum tragen oder zum führen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "5. Es sucht jemand einen mosingenen Kron= Leuchter mit 8 Lichtstöcken, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "6. Es verlangt jemand eine nicht gar grosse el= serne Geld=Kafsa zu kaufen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "7. Es verlangt jemand einen glatten nussbaumern zweythürigen Kasten, der Liebhaber ist im Be= richthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "8. Man verlangt einen noch guten Kachel=Ofen mittelmäsiger Grösse mit oder ohne Fufs, der Liebhaber ist im Berichtshaus zu erfragen, lei= det aber keinen Verzug."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "1. Ein Lofament mitten im Offenburger= Hof, wie der Augenschein zeigen wird, auf nächste Fasnacht oder Pfingst,Fronfasten zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "2. Ein sauberes Lofament an der Spalen von ei= ner Stuben und Redekammer, oder nach Belieben zwo Kammern samt einem heitern Sommerhaus alles auf einem Boden, und nach Belieben Stallung und Heubühne, auf Pfingst=Fronfasten zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "3. Ein Lofament mit einem schönen Laden und Laden,Stüblein nebst einem grossen Sommers= haus, Stuben, Kuchin, 2 grosse Kammern, einem besondern Keller, Holzhaus, ein beschlos= senes Bauchhaus, auf der Eisengas, im Be= richthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "4. Ein Lofament in der Fröschgas von einer Stu= ben, 2 Kammern und Plaz zum Holz, auf Pfingst,Fronfasten zu beziehen, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "5. Ein Lofament für 2 Personen in der Weissen= gas, bestehend aus einem Stüblein und Alle= kofen, Plaz zum Hausrath zu stellen, auf ei= nem Boden, wie auch Plaz zum Holz, Bruns= nen um Haus, a 1 s Pfinst Zins des Jahrs, kan gleich bezogen werden, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "6. Ein schönes Lofament ebenes Fusses auf ei= nem Boden von 3 Stuben, einem grossen Saal, Kammern, Kuchin, Keller, Plaz zum Holz, Zutritt zum Bauchhaus, und, so belie= big, einem Garten in der Aeschmer Vorstadt, im Berichtshaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "7. Eine grosse doppelte Frucht=Schütte auf E. E. Geselschaft zum hohen Ruf."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "text": "8. Bis den 1sten dis wird eine säugende Hündin begehrt, um etliche junge Hunde zu auferzie= hen, gegen einer Erkanntlichkeit; wo sich anzu= melden, ist im Berichtshaus ohne Entgeldt zu vernehmen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "9. Auf künftige Weyhnacht ist unter der St. Pe= ters=Schul ein geräumiges Magazin zu verlei= hen, darum sich in dem Schulhaus anzu= melden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt",
      "text": "1. In ein wackeres protestantisches Haus in denen Niederlanden wird ein Candidatus Theologiae, der neben andern auch die französische Sprach verstünde, zu einem Haus,Präceptor begehrt, weshalb sich im Berichtshaus zu melden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt",
      "text": "2. Man verlangt einen Menschen in eine Fabri= ke, der sich zu allerley Haus,Geschäften brau= chen liesse, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt",
      "text": "3. Man sucht einen Stallknecht in ein Wirths, haus, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt",
      "text": "4. Ein"
    }
  ]
}

